/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import './login.css';
import right from '../../images/personal/right.png';
import {Title} from '../../share';
import {getData, goNext} from '../../utils';
export default class Publish extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            account: '',
            password: '',
        }
    }
    render() {
        return <div className="cm-mlr-15">
            <div>
                <img src="" alt=""/>
                <div>
                    <div></div>
                    <div></div>
                </div>
            </div>
            <div className="cm-line"></div>
            <div className="cm-item">
                <div>
                <img src="" alt=""/>
                <span>我发布的</span>
                </div>
                <div><span>0</span><img src="" alt=""/></div>

            </div>
        </div>
    }
}
